import React, { Suspense } from "react"
import ReactDOM from "react-dom"
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Outlet,
  useOutletContext,
} from "react-router-dom"
import * as serviceWorker from "./serviceWorker"
import { ToastContainer, toast } from "react-toastify"
import { MDBContainer } from "mdb-react-ui-kit"
import "mdb-react-ui-kit/dist/css/mdb.min.css"
import "@fortawesome/fontawesome-free/css/all.min.css"
import "./index.css"
import "./libs/css/gradientBg.css"
import "./libs/css/Animate.min.css"
import NavBar from "./components/navBar"

const WheelMng = React.lazy(() => import("./App"))
// const NavBar = React.lazy(() => import("./components/navBar"))

const WidgetPage = React.lazy(() => import("./widgetPage"))

window.toast = toast

window.wait = async (t = 1) => {
  return new Promise((resolve) => setTimeout(() => resolve, t * 1000))
}

window.imageUrlFixing = (url = "") => {
  return url.replace("p16-sign-va.tiktokcdn.com", "p16-va.tiktokcdn.com")
}

window.randomInt = (min = 10, max = 99) =>
  Math.floor(Math.random() * (max - min + 1) + min)

const Loading = () => {
  return <div>Loading</div>
}

const GamesPage = () => {
  return <h5 className="text-light">Games page</h5>
}

const HomePage = () => {
  return <h5 className="text-light">Home page</h5>
}

const MngWheelGame = () => {
  return
  ;<Suspense fallback={<Loading />}>
    <WheelMng />
  </Suspense>
}
const WidgetWheelOfFortune = () => {
  const [event, settings] = useOutletContext()
  const WheelGame = React.lazy(() => import("./Game"))
  return (
    <Suspense fallback={<Loading />}>
      <WheelGame event={event} settings={settings} />
    </Suspense>
  )
}

const GeneralLayout = () => {
  return (
    <>
      <NavBar />
      <MDBContainer
        style={{
          paddingTop: "80px",
          position: "relative",
          minHeight: "100vh",
        }}
      >
        <Outlet />
        <footer className="container d-flex justify-content-between py-2 position-absolute bottom-0">
          <div>
            Developed by
            <a href="https://fb.com/trinhdacquang" target="_blank">
              {" "}
              QuangPlus
            </a>
          </div>
          <div>
            <a className="me-2" href="#">
              Support
            </a>
            <a className="me-2" href="#">
              Contact
            </a>
            <a className="me-2" href="#">
              Pricing
            </a>
          </div>
        </footer>
      </MDBContainer>
      <ToastContainer
        theme="light"
        position="bottom-right"
        toastStyle={{
          fontSize: "14px",
          textAlign: "left",
        }}
        hideProgressBar={false}
      />
      <div id="gradient_bg"></div>
    </>
  )
}

const Main = () => {
  return (
    // <MDBContainer className="position-relative" style={{ minHeight: "100vh" }}>
    <Router>
      <Routes>
        <Route path="/" element={<GeneralLayout />}>
          <Route path="/" element={<HomePage />} />
          <Route path="games" element={<Outlet />}>
            <Route path="/" element={<GamesPage />} />
          </Route>
          <Route end path="games/wheel-of-fortune" element={<MngWheelGame />} />
        </Route>
        <Route
          path="widget"
          element={
            <Suspense fallback={<Loading />}>
              <WidgetPage />
            </Suspense>
          }
        >
          <Route path="wheel-of-fortune" element={<WidgetWheelOfFortune />} />
        </Route>
        <Route
          path="*"
          element={
            <div className="text-center">
              <h5>ERROR! Page not found</h5>
            </div>
          }
        />
      </Routes>
    </Router>
    // </MDBContainer>
  )
}

ReactDOM.render(<Main />, document.getElementById("root"))

serviceWorker.unregister()
